import {
  ContactInfo,
  DetailsWrapper,
  ImageWrapper,
  StyledContactSection,
} from "../styles/ContactSection.styled";
import { SectionHeading } from "../styles/SectionHeading.styled";

export const ContactSection = () => {
  return (
    <>
      <StyledContactSection>
        <SectionHeading>
          <h1>Contact</h1>
        </SectionHeading>
        <DetailsWrapper>
          <ContactInfo>
            <ImageWrapper>
              <img src="./images/" alt="Contact" />
            </ImageWrapper>
          </ContactInfo>
        </DetailsWrapper>
      </StyledContactSection>
      <hr />
    </>
  );
};
